window.bookSummaryJSON = "<p><b>Imagine if you could be a fly on the wall as a family enterprise becomes one of the most successful companies in the world. </b><b><i>The Target Story</i></b><b> will help you understand and adopt the competitive strategies, workplace culture, and daily business practices that enabled the big box store to become the retail giant it is today.</b> </p> <p>In an industry that has seen constant disruption over the last two decades, Target has experienced tremendous growth. Establishing a strong e-commerce business and cultivating a sought-after in-store experience has kept this iconic brand at the top of the retail game. From same-day fulfillment to brand partnerships, Target has successfully fought the domination of online marketplaces by thinking outside the big box. </p> <p>The growth, prosperity, and expansion strategies that can be gleaned from the history of the Target Corporation amounts to a masterclass in business. Yet, the Target story has never been adequately presented. Until now. </p> <p>Through the story of Target, youâ€™ll learn: </p> <p></p> <ul> <li>How to remain nimble in times of tremendous change. </li> <li>How to reinvent a six-decade-old iconic brand. </li> <li>How to know when to build it yourself or bring in the experts. </li> <li>When to change the entire way you do business. </li> <li>And much, much more.</li> </ul>"; 
